import { useState } from "react";

function App() {
  // membuat react state dengan default value 0
  const[count, setCount] = useState(0);



  return (
    <div>
      <h1>{count}</h1>
      <button onClick={setCount + 1}>Plus</button>
      <button onClick={setCount + 1}>Minus</button>
    </div>
  );
}

export default App;
